import Link from 'next/link'

const Toolbar = () => {
	return (
		<div
			style={{
				display: 'flex',
				justifyContent: 'center',
				alignItems: 'center',
			}}
		>
			<Link href="/">Home</Link>

			<Link href="about">About</Link>
		</div>
	)
}

export default Toolbar
